package 시험연습;

public class Acorn2 {

	String name;
	String id;
	String pw;
	
	
	public Acorn2(String name, String id, String pw) {
		super();
		this.name = name;
		this.id = id;
		this.pw = pw;
	}


	public Acorn2() {
		// TODO Auto-generated constructor stub
	}


	@Override
	public String toString() {
		return "Acorn2 [name=" + name + ", id=" + id + ", pw=" + pw + "]";
	}


	public String getName() {
		return name;
	}


	public String getId() {
		return id;
	}


	public String getPw() {
		return pw;
	}
	
	
	
	
	
	
}
